import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Categories from './Categories';
import MenuItems from './MenuItems';
import SelectedItems from './SelectedItems';

ReactDOM.render(
  <flex>
    <React.StrictMode>
      <Categories/>
      <MenuItems />
      <SelectedItems />
    </React.StrictMode>,
    document.getElementById('root')
  </flex>
);
